import { NavLink } from 'react-router-dom';
import s from './Navbar.module.css';

const Navbar = () => {
    return (
        <nav className={s.nav}>
            <ul className={s.ul}>
                <li className={s.a}>
                    <NavLink to='/profile'  activeClassName={s.activeLink}>Profile</NavLink></li>
                <li className={s.a}>
                    <NavLink to='/dialogs' activeClassName={s.activeLink}>Messages</NavLink></li>
                <li className={s.a}>
                    <NavLink to='#' activeClassName={s.activeLink}>News</NavLink></li>
                <li className={s.a}>
                    <NavLink to='#' activeClassName={s.activeLink}>Music</NavLink></li>
                <li className={s.a}>
                    <NavLink to='#' activeClassName={s.activeLink}>Settings</NavLink>
                    </li>
            </ul>
        </nav>
    )
}
export default Navbar;
